import React from 'react';
import { BrowserRouter, Switch, Route } from "react-router-dom";
import Home from "./pages/Home.js";
import Notfound from "./pages/Notfound";

const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" component={Home} />

      </Switch>
    </BrowserRouter>
  );
};

export default App;
